import { Rout, Switch, Route} from 'react-router-dom';
import './App.css';
import Home from './pages/home'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="users/*" element={<Users />} />
        </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
